import React, { Component } from 'react'

class Coursesale extends Component {
    sumPrice(price){
        this.setState({total: this.state.total + price});
    }

    constructor(props) {
        super(props)

        this.state = {
             total: 0
        }
    }

    render() {

        return (

            <div>
                {this.props.items.map((item,index)=>{
                   <p>{item}</p> 
                })}
            </div>
        )
    }
}
export default Coursesale;
